namespace Mi9.CodingChallenge.Controllers
{
    using System.Collections.Generic;
    using System.Linq;
    using System.Net.Http;
    using Base;
    using Models;

    /// <summary>
    /// The Shows controller
    /// </summary>
    public class ShowsController : ApiControllerBase
    {
        /// <summary>
        /// Filter request message
        /// </summary>
        /// <param name="message">
        /// The shows payload
        /// </param>
        /// <returns>
        /// The <see cref="HttpResponseMessage"/>
        /// </returns>
        public HttpResponseMessage Filter(RequestMessage message)
        {
            return this.ValidateRequest(() => FilterPayload(message.Payload));
        }

        /// <summary>
        /// Filters the payload
        /// </summary>
        /// <param name="payload">
        /// The list of payloads
        /// </param>
        /// <returns>
        /// The <see cref="IEnumerable{ShowViewModal}" />
        /// </returns>
        private static IEnumerable<ShowViewModel> FilterPayload(IEnumerable<Payload> payload)
        {
            return payload.Where(x => x.Drm == true && x.EpisodeCount > 0).Select(Map);
        }

        /// <summary>
        /// Maps the values from <see cref="Payload"/> to <see cref="ShowViewModel"/>
        /// </summary>
        /// <param name="payload">
        /// The payload
        /// </param>
        /// <returns>
        /// The <see cref="ShowViewModel"/>
        /// </returns>
        private static ShowViewModel Map(Payload payload)
        {
            return new ShowViewModel
            {
                Image = payload.Image == null ? string.Empty : payload.Image.ShowImage,
                Slug = payload.Slug,
                Title = payload.Title
            };
        }
    }
}

