namespace Mi9.CodingChallenge.Controllers.Base
{
    using System;
    using System.Net;
    using System.Net.Http;
    using System.Web.Http;
    using Models;
    using Models.Interface;

    /// <summary>
    /// The Api Controller Base
    /// </summary>
    public class ApiControllerBase : ApiController
    {
        /// <summary>
        /// Validate Request
        /// </summary>
        /// <typeparam name="TResult">
        /// The type of result
        /// </typeparam>
        /// <param name="action">
        /// The action
        /// </param>
        /// <returns>
        /// The <see cref="HttpResponseMessage"/>
        /// </returns>
        public HttpResponseMessage ValidateRequest<TResult>(Func<TResult> action)
        {
            IApiResponse response;
            try
            {
                response = new ApiResponse<TResult>();
                ((ApiResponse<TResult>)response).Response = action();

                return Request.CreateResponse<IApiResponse>(HttpStatusCode.OK, response);
            }
            catch
            {
                response = new ApiErrorResponse();
                ((ApiErrorResponse)response).Error = "Could not decode request: JSON parsing failed";

                return Request.CreateResponse<IApiResponse>(HttpStatusCode.BadRequest, response);
            }
        }
    }
}

