namespace Mi9.CodingChallenge.Tests
{
    using System.Collections.Generic;
    using System.Net;
    using System.Net.Http;
    using System.Web.Http;
    using Controllers;
    using Models;
    using Microsoft.VisualStudio.TestTools.UnitTesting;
    using Newtonsoft.Json;

    /// <summary>
    /// The Shows controller tests
    /// </summary>
    [TestClass]
    public class ShowsControllerTests
    {
        /// <summary>
        /// Should return HTTP 404 Message if null request
        /// </summary>
        [TestMethod]
        public void Filter_NullValue_ShouldReturn404HttpMessage()
        {
            var controller = new ShowsController
            {
                Request = new HttpRequestMessage(),
                Configuration = new HttpConfiguration()
            };

            var httpResponse = controller.Filter(null);

            Assert.AreEqual(httpResponse.StatusCode, HttpStatusCode.BadRequest);
        }

        /// <summary>
        /// Should return Error Message if null request
        /// </summary>
        [TestMethod]
        public void Filter_NullValue_ShouldReturnErrorMessage()
        {
            var controller = new ShowsController
            {
                Request = new HttpRequestMessage(),
                Configuration = new HttpConfiguration()
            };

            var httpResponse = controller.Filter(null);

            string jsonContent = httpResponse.Content.ReadAsStringAsync().Result;
            var response = JsonConvert.DeserializeObject<ErrorMessageView>(jsonContent, new JsonSerializerSettings { TypeNameHandling = TypeNameHandling.Objects });

            Assert.AreEqual(response.Error, "Could not decode request: JSON parsing failed");
        }

        /// <summary>
        /// Should return valid json if valid request
        /// </summary>
        [TestMethod]
        public void Filter_ValidRequest_ShouldReturnResponseWithFilteredShows()
        {
            var controller = new ShowsController
            {
                Request = new HttpRequestMessage(),
                Configuration = new HttpConfiguration()
            };

            var validateResponse = controller.Filter(GetRequestMessage());

            string jsonContent = validateResponse.Content.ReadAsStringAsync().Result;
            var response = JsonConvert.DeserializeObject<ApiResponse<List<Payload>>>(jsonContent, new JsonSerializerSettings { TypeNameHandling = TypeNameHandling.Objects });

            Assert.IsNotNull(response.Response);
            Assert.AreEqual(response.Response.Count, 3);
        }

        /// <summary>
        /// Shows 1 - 3 return true when filtered, 4 - 5 return false
        /// </summary>
        /// <returns>The <see cref="RequestMessage"/></returns>
        private RequestMessage GetRequestMessage()
        {
            return new RequestMessage
            {
                Payload = new List<Payload>
                {
                    new Payload
                    {
                        Title = "Show 1",
                        Drm = true,
                        EpisodeCount = 1
                    },
                    new Payload
                    {
                        Title = "Show 2",
                        Drm = true,
                        EpisodeCount = 2
                    },
                    new Payload
                    {
                        Title = "Show 3",
                        Drm = true,
                        EpisodeCount = 3
                    },
                    new Payload
                    {
                        Title = "Show 4",
                        Drm = false,
                        EpisodeCount = 3
                    },
                    new Payload
                    {
                        Title = "Show 4",
                        Drm = true,
                        EpisodeCount = 0
                    }
                }
            };
        }
    }

    /// <summary>
    /// The Error Message View
    /// </summary>
    internal class ErrorMessageView
    {
        public string Error { get; set; }
    }
}

